    }
}

.list-alternate {
    margin-top: $margin-top-list-alternate;
    li {
        margin: $margin-list-alternate-li;
    }
}

//ICON
.list-icon {
    margin-top: $margin-top-list-icons;
    display: $display-list-icon;
    flex-direction: $flex-direction-icon;
    padding-left: $padding-list-icon;
